    pragma solidity >=0.5.0 <0.7.0;

contract scrap_chain {
    struct Certificate {
        uint certificateId;
        uint requestId;
        uint scraperId;
        string certificate;
        string datetime;
    }

    struct CarDetails {
        uint carDetailId;
        uint loginId;
        string carModel;
        string engineNum;
        string chaseNo;
        string seater;
        string regNo;
        string status;
    }

    Certificate[] public certificates;
    CarDetails[] public carDetails;

    function addCertificate(
        uint certificateId,
        uint requestId,
        uint scraperId,
        string memory certificateData,
        string memory datetime
    ) public {
        certificates.push(Certificate({
            certificateId: certificateId,
            requestId: requestId,
            scraperId: scraperId,
            certificate: certificateData,
            datetime: datetime
        }));
    }

    function addCarDetails(
        uint carDetailId,
        uint loginId,
        string memory carModel,
        string memory engineNum,
        string memory chaseNo,
        string memory seater,
        string memory regNo,
        string memory status
    ) public {
        carDetails.push(CarDetails({
            carDetailId: carDetailId,
            loginId: loginId,
            carModel: carModel,
            engineNum: engineNum,
            chaseNo: chaseNo,
            seater: seater,
            regNo: regNo,
            status: status
        }));
    }
}
